commits.content:
.is-fixed {
   position: fixed;
   left: 0;
   width: 100%;
}

.mb-2{
   margin-bottom: 1.6rem;
}

.is-block {
   display: block;
}

.is-uppercase {
   text-transform: uppercase;
}

.is-center {
   justify-content: center;
}

.border {
   border: 1px solid var(--border-color);
}

.bg-light-dark {
   background-color: var(--color-bg-L-D);
}

.m-b {
   margin-bottom: rem(32px);
}

.is-visually-hidden {
   position: absolute;
   width: rem(1px);
   height: rem(1px);
   margin: rem(-1px);
   border: 0;
   padding: 0;
   white-space: nowrap;
   clip-path: inset(100%);
   clip: rect(0 0 0 0);
   overflow: hidden;
 }
